                <span>{title}</span>
            </div>
            <div className="box" media_type={media_type} id={id} >
                <img src={poster ? `${img_300}${poster}` : unavailable} alt={title}></img>
                <span>{title}</span>
            </div>
            
            <div className="box" media_type={media_type} id={id} >
                <img src={poster ? `${img_300}${poster}` : unavailable} alt={title}></img>
                <span>{title}</span>
            </div>
  
            <div className="box" media_type={media_type} id={id} >
                <img src={poster ? `${img_300}${poster}` : unavailable} alt={title}></img>
                <span>{title}</span>
            </div>
         
            </div>
        </div>
    );
};

export default Main;
